SELECT COUNT(*) as agg_0, COUNT(*) as agg_1 FROM "keyword" LEFT OUTER JOIN "movie_keyword" ON "keyword"."id" = "movie_keyword"."keyword_id" LEFT OUTER JOIN "title" ON "movie_keyword"."movie_id" = "title"."id"  WHERE "title"."title" NOT LIKE '%the%' AND ("title"."episode_nr" BETWEEN 5.832729100459393 AND 8.955222841655576 OR "title"."id" <= 789064 OR "title"."episode_nr" >= 5.939956448104956) AND "movie_keyword"."id" <= 776675 AND "movie_keyword"."keyword_id" BETWEEN 145 AND 1570 AND "keyword"."phonetic_code" NOT LIKE '%R1652%' AND "movie_keyword"."movie_id" <= 998888;